import React from 'react';
import Navigation from '../components/Navigation';
import SocialNetworks from '../components/SocialNetworks';
import Cube from '../components/home/Cube';


const Home = () => {
  return (
    <div className='home'>
      <Navigation />

      <div className="home-content">

        <div className="home-content-text">
          <h3>Thomas Bressel</h3>

          <h4>Développement
             Web et Web Mobile 2023</h4>
          <a href="./medias/CD.pdf">
            <span class="home-content-pdf">Télécharger le CV</span>
          </a>

        </div>

        <Cube />


      </div>

      <SocialNetworks />


    </div>
  );
};

export default Home;
